void twistShift_fullCell_yShP2_3xSerP1(const double dyDo, const double yOff, const double *ySh, tsStruct *tsData, const int xIdx, const bool pushNew) 
{ 
  // dyDo:   y cell length of the donor cell.
  // yOff:   yOffset between the donor and target cells (in the direction of the shift).
  // ySh:    yShift translated to [-1,1] logical space.
  // tsData: twist-shift matrices and vectors.
  // xIdx:   x-index of the cell.
  // pushNew: push_back a new matrix (true) or add contribution to the last matrix (false).

  tsData->mat.setZero();

  tsData->mat(0,0) += 1.0; 
  tsData->mat(1,1) += 1.0; 
  tsData->mat(2,0) += -(0.7071067811865475*(4.898979485566357*yOff-3.464101615137754*ySh[0]))/dyDo; 
  tsData->mat(2,1) += (2.449489742783178*ySh[1])/dyDo; 
  tsData->mat(2,2) += 1.0; 
  tsData->mat(3,3) += 1.0; 
  tsData->mat(4,0) += (2.449489742783178*ySh[1])/dyDo; 
  tsData->mat(4,1) += -(0.1414213562373095*(24.49489742783179*yOff-15.49193338482967*ySh[2]-17.32050807568877*ySh[0]))/dyDo; 
  tsData->mat(4,4) += 1.0; 
  tsData->mat(5,5) += 1.0; 
  tsData->mat(6,3) += -(0.7071067811865475*(4.898979485566357*yOff-3.464101615137754*ySh[0]))/dyDo; 
  tsData->mat(6,5) += (2.449489742783178*ySh[1])/dyDo; 
  tsData->mat(6,6) += 1.0; 
  tsData->mat(7,3) += (2.449489742783178*ySh[1])/dyDo; 
  tsData->mat(7,5) += -(0.1414213562373095*(24.49489742783179*yOff-15.49193338482967*ySh[2]-17.32050807568877*ySh[0]))/dyDo; 
  tsData->mat(7,7) += 1.0; 

  if (pushNew) {
    tsData->cellMat[xIdx-1].push_back(tsData->mat);
  } else {
    tsData->cellMat[xIdx-1].back() += tsData->mat;
  };

}

void twistShift_matVecMult_3xSerP1(tsStruct *tsData, const int xIdx, const int matIdx, const double *fldDo, double *fldTar) 
{ 
  // tsData: twist-shift matrices and vectors.
  // xIdx:   x-index of the cell.
  // matIdx: index of the matrix to be assigned.
  // fldDo:  donor field.
  // fldTar: target field.

  tsData->vecDo << fldDo[0],fldDo[1],fldDo[2],fldDo[3],fldDo[4],fldDo[5],fldDo[6],fldDo[7];

  tsData->vecTar = tsData->cellMat[xIdx-1][matIdx-1] * tsData->vecDo;

  Eigen::Map<Eigen::VectorXd>(fldTar,8,1) += tsData->vecTar;

}

